<span class="line"><span style="color:#A6ACCD;">    --sort </span><span style="color:#89DDFF;">&lt;</span><span style="color:#A6ACCD;">key</span><span style="color:#89DDFF;">&gt;</span><span style="color:#A6ACCD;">          field name to sort on</span></span>
