<span class="line"><span style="color:#A6ACCD;">    -t, --track</span><span style="color:#89DDFF;">[=(</span><span style="color:#A6ACCD;">direct</span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;">inherit</span><span style="color:#89DDFF;">)]</span></span>
