<span class="line"><span style="color:#A6ACCD;">git stash store </span><span style="color:#89DDFF;">[</span><span style="color:#A6ACCD;">-m</span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;">--message </span><span style="color:#89DDFF;">&lt;</span><span style="color:#A6ACCD;">message</span><span style="color:#89DDFF;">&gt;]</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">[</span><span style="color:#A6ACCD;">-q</span><span style="color:#89DDFF;">|</span><span style="color:#A6ACCD;">--quiet</span><span style="color:#89DDFF;">]</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&lt;</span><span style="color:#A6ACCD;">commit</span><span style="color:#89DDFF;">&gt;</span></span>
